import { createStore } from "vuex";

export default createStore({
  state: {
    user: null,
    idToken: null,
  },
  getters: {
    user(state) {
      return state.user;
    },
    idToken(state) {
      return state.idToken;
    },
  },
  mutations: {
    updateUser(state, user_info) {
      state.user = user_info;
    },
    updateidToken(state, token) {
      state.idToken = token;
    },
  },
  actions: {},
  modules: {},
});
